        FAQtitle1: 'Q1: What is a block hash?',
        FAQcontent1:
          'A block hash is the DNA of a piece of data, and each block hash is unique, random, and unbreakable.',
        FAQtitle2: 'Q2: What is blockchain?',
        FAQcontent2:
          'Blockchain is essentially a shared database in which data or information is stored. It has the characteristics of non-forgery, full traces, traceability, openness and transparency, and collective maintenance.',
        FAQtitle3:
          "Q3: Centralized wallet? Decentralized wallet? Why can't the centralized wallet query the transfer?",
        FAQcontent3:
          'For example: your own wallet address is A, you transfer 10 USDT to address E, but you use the transaction hash value to query, you can only query a random account book address B (or C or D, etc.) of the service provider etc) transfers with E. In the same way, E cannot know whether the 10 USDTs were transferred by you, because E can only see that the account book address B transferred 10 USDTs to him. This is why centralized wallets cannot query real transfer information on the blockchain.',
        FAQtitle4: 'Q4: Why do I keep winning or not winning?',
        FAQcontent4:
          'First of all, it is a small probability event (the definition of a small probability event) that does not win the lottery many times in a row. Secondly, winning and not winning the lottery is a random event, and the frequency of random events will tend to a stable value. In the non-iterative case, the probability of things appearing is equal to everyone, in this case, everyone is fair. At the same time, random events will follow the law of large numbers (under the condition that the experiment is unchanged, repeat the experiment many times, the frequency of random events is similar to its probability definition of the law of large numbers), and in the case of the increasing frequency of transfers, winning or not winning the lottery will tend to a stable value. So please continue to transfer money. As the frequency of transfers increases, the total probability of winning the lottery will increase.',
