        Teaminvestmentisrunning1:
          'Pendiri TRON (TRX) Justin Sun lulus dari Universitas Lakeside Ketua Eksekutif Alibaba Jack Ma - lulusan milenial pertama program tersebut. Sun pergi ke Hangzhou, China untuk memberikan kuliah dan menerbitkan makalah dari tanggal 26 hingga 28 Maret, dan berhasil menyelesaikan karir akademisnya dalam tiga tahun studi. Pada sore hari tanggal 26 Maret, Mr. Sun menyerahkan tesis kelulusannya "The Birth of the Decentralized Internet", merinci pemikirannya tentang masa lalu, sekarang dan masa depan industri blockchain. Bapak Sun juga menyampaikan pembelaan disertasinya yang berjudul "Refleksi dan Refleksi Perjalanan Empat Tahun Seorang Pengusaha", di mana beliau memberikan analisis yang luas dan mendalam tentang pemikiran dan pembelajarannya sejak menjadi seorang wirausaha pada tahun 2014. Bapak Sun adalah salah satunya. dari sedikit pengusaha yang memilih untuk terlibat dalam industri teknologi blockchain di Lakeside University. Profesor dan mahasiswa universitas, termasuk Dekan Akademik Zeng Ming, menanggapi laporan Profesor Sun secara positif.',
