        Teaminvestmentisrunning3:
          'Pada pukul 0:00 tanggal 4 Juni, Justin Sun, lulusan pertama Universitas Ma Yunhupan pasca 90-an, pendiri TRON, dan CEO BitTorrent, mengumumkan bahwa ia telah berhasil memotret Makan Siang Amal eBay ke-20, yang menjadi harga tertinggi " Buffett Charity Lunch" dalam sejarah. . Justin Sun adalah pendiri TRON, sistem operasi aplikasi terdesentralisasi blockchain terbesar di dunia, dan CEO BitTorrent, perusahaan distribusi protokol P2P terbesar di dunia. Dia telah menjadi pemenang Lelang Amal Warren Buffett Luncheon tahun ini dan juga akan menjadi pemimpin global. Pengusaha pasca-90-an pertama yang makan siang bersama Buffett. Justin Sun menjual "Buffett Luncheon" 2019 dengan harga rekor $4.567.888, dan semua hasil lelang disumbangkan ke yayasan amal yang berbasis di San Francisco, Glide Foundation. Warren Buffett, miliarder legendaris dan CEO Berkshire Hathaway, telah mendukung GLIDE Foundation selama 20 tahun terakhir dalam bentuk lelang makan siang untuk membantu para tunawisma dan orang miskin di Teluk di distrik tersebut.',
