        FAQtitle1: 'Q1: Apa itu hash blok?',
        FAQcontent1:
          'Sebuah blok hash adalah DNA dari sepotong data, dan setiap blok hash adalah unik, acak, dan tidak dapat dipecahkan.',
        FAQtitle2: 'Q2: Apa itu blockchain?',
        FAQcontent2:
          'Blockchain pada dasarnya adalah database bersama di mana data atau informasi disimpan. Ini memiliki karakteristik non-pemalsuan, jejak penuh, ketertelusuran, keterbukaan dan transparansi, dan pemeliharaan kolektif.',
        FAQtitle3:
          'Q3: Dompet terpusat? Dompet terdesentralisasi? Mengapa dompet terpusat tidak dapat menanyakan transfer?',
        FAQcontent3:
          'Misalnya: alamat dompet Anda sendiri adalah A, Anda mentransfer 10 USDT ke alamat E, tetapi Anda menggunakan nilai hash transaksi untuk kueri, Anda hanya dapat menanyakan alamat buku rekening acak B (atau C atau D, dll.) dari layanan provider dll) mentransfer dengan E. Dengan cara yang sama, E tidak dapat mengetahui apakah 10 USDT telah Anda transfer, karena E hanya dapat melihat bahwa alamat buku rekening B mentransfer 10 USDT kepadanya. Inilah sebabnya mengapa dompet terpusat tidak dapat menanyakan informasi transfer nyata di blockchain.',
        FAQtitle4: 'Q4: Mengapa saya terus menang atau tidak menang?',
        FAQcontent4:
          'Pertama-tama, ini adalah peristiwa probabilitas kecil (definisi dari peristiwa probabilitas kecil) yang tidak memenangkan lotre berkali-kali berturut-turut. Kedua, menang dan tidak menang lotre adalah peristiwa acak, dan frekuensi peristiwa acak akan cenderung ke nilai yang stabil. Dalam kasus non-iteratif, probabilitas munculnya sesuatu sama dengan semua orang, dalam hal ini, semua orang adil. Pada saat yang sama, peristiwa acak akan mengikuti hukum bilangan besar (dengan syarat bahwa eksperimen tidak berubah, ulangi eksperimen berkali-kali, frekuensi peristiwa acak mirip dengan definisi probabilitasnya dari hukum bilangan besar), dan dalam kasus peningkatan frekuensi transfer, menang atau tidak menang lotre akan cenderung menjadi nilai yang stabil. Jadi silakan lanjutkan untuk mentransfer uang. Saat frekuensi transfer meningkat, kemungkinan total memenangkan lotre akan meningkat.',
