        Agencyperformanceintroduction:
          'Pengenalan kinerja agensi\r\n\r\nContoh 1:\r\n\r\nLevel super direktur (Y) telah mengembangkan 5 agen dengan total volume transaksi 10 juta, di antaranya agen A 6 juta + agen B 2 juta + agen C 1 juta + agen D 700,000 + agen E 300,000, perhitungan komisi adalah sebagai berikut:\r\n\r\nTotal komisi = 10 juta * {0} (rasio rabat) = {1}\r\nA=6 juta*{2}(tarif rabat)={3}\r\nB=2 juta*{4}(tarif rabat)={5}\r\nC=1 juta*{6}(tarif rabat)={7}\r\nD=700.000*{8}(tarif rabat)={9}\r\nE=300,000*{10}(tarif rabat)={11}\r\n\r\nContoh 1 dekomposisi skema:\r\n\r\nTingkat direktur super (Y) pendapatan mingguan = {12}\r\n\r\nSelain itu, agen A telah mengembangkan 10 bawahan dengan total volume transaksi 6 juta, setiap bawahan memiliki volume transaksi 600.000, dan komisi setiap bawahan adalah 600.000*{13}={14}, maka perhitungan komisi agen A:\r\n\r\nPendapatan mingguan Agen A = {15}\r\n\r\n\r\nContoh 2:\r\n\r\nY telah mengembangkan 21 agen (A-U) dengan total volume transaksi 20 juta, agen A dengan volume transaksi 10 juta, dan 20 agen lainnya (B-U), masing-masing dengan volume transaksi 500.000, dan komisi dihitung sebagai berikut :\r\n\r\nTotal komisi = 20 juta * {16} (rasio rabat) = {17}\r\nA=10 juta*{18}(rasio rabat)={19}\r\nTotal B-U = 500,000*{20} (rasio rabat)*20={21}\r\n\r\nContoh 2 dekomposisi skema:\r\n\r\nTingkat direktur super (Y) pendapatan mingguan = {22}\r\n\r\nAgen A juga seorang direktur super, dan rumus perhitungannya sama dengan Y, dan seterusnya.\r\n\r\nSetiap agen yang bergabung dengan 58 hash adalah agen tingkat pertama, yaitu: mode agen super unlimited;\r\n\r\nCatatan: Semua volume perdagangan agensi adalah siklus setiap minggu, dan dihitung ulang pada pukul 24:00 pada hari Minggu;\r\n\r\nSeluruh rangkaian model uang agensi tidak perlu menginvestasikan sepeser pun, cukup angkat ponsel dan beriklan setiap hari, bantu anggota Anda menjelaskan permainan hash, perkenalkan teman untuk bergabung dengan agensi, dan komisi mingguan akan ditransfer secara otomatis ke dompet!\r\n\r\nSemakin cepat Anda bergabung, semakin banyak uang yang Anda hasilkan, dan pasar disediakan untuk mereka yang siap!\r\n\r\nMembangun tim seperti serigala, menjadi kaya bukanlah mimpi!',
