        Teaminvestmentisrunning1:
          'Người sáng lập TRON (TRX) Justin Sun đã tốt nghiệp Đại học Lakeside của Chủ tịch điều hành Alibaba Jack Ma - sinh viên tốt nghiệp thiên niên kỷ đầu tiên của chương trình. Ông Sun đã đến Hàng Châu, Trung Quốc để thuyết trình và xuất bản bài báo từ ngày 26 đến 28 tháng 3, và hoàn thành xuất sắc sự nghiệp học tập của mình trong ba năm học. Chiều ngày 26 tháng 3, ông Sun đã trình bày luận văn tốt nghiệp "Sự ra đời của Internet phi tập trung", trình bày chi tiết những suy nghĩ của ông về quá khứ, hiện tại và tương lai của ngành công nghiệp blockchain. Ông Sun cũng đã đệ trình bản bảo vệ luận án của mình với tựa đề "Những suy ngẫm và ngẫm nghĩ về hành trình bốn năm của một doanh nhân", nơi ông đưa ra một phân tích sâu và rộng về những suy nghĩ và bài học kinh nghiệm của mình kể từ khi trở thành một doanh nhân vào năm 2014. Ông Sun là một trong những trong số ít doanh nhân chọn tham gia vào ngành công nghệ blockchain tại Đại học Lakeside. Các giáo sư và sinh viên đại học, bao gồm cả Hiệu trưởng Zeng Ming, đã phản ứng tích cực với báo cáo của Giáo sư Sun.',
        Teaminvestmentisrunning2:
          'Vào ngày 17 và 18 tháng 1, theo giờ địa phương ở San Francisco, Trung tâm Nghệ thuật Yerba Beuna đã mở ra một sự kiện tiên tiến mang tên công nghệ blockchain và tiền tệ kỹ thuật số - được tổ chức bởi TRON Được tổ chức bởi NiTROn Summit. 12 bài phát biểu của các giám đốc điều hành công ty, 9 diễn đàn công nghệ và cuộc trò chuyện chưa từng có giữa người sáng lập Tron Justin Sun và huyền thoại NBA Kobe Bryant - Trận động đất và mưa băng giá lạnh ở San Francisco không thể ngăn được làn sóng trên toàn thế giới Sự cuồng nhiệt của người hâm mộ tại địa điểm, địa điểm có thể chứa hàng nghìn người đã chật kín.',
        Teaminvestmentisrunning3:
          'Vào lúc 0:00 ngày 4 tháng 6, Justin Sun, sinh viên đầu tiên tốt nghiệp sau thập niên 90 của Đại học Ma Yunhupan, người sáng lập TRON và Giám đốc điều hành của BitTorrent, thông báo rằng anh ấy đã chụp ảnh thành công Bữa trưa từ thiện trên eBay lần thứ 20, trở thành buổi ăn trưa có giá cao nhất " Bữa trưa từ thiện Buffett ”trong lịch sử. . Justin Sun là người sáng lập TRON, hệ điều hành ứng dụng phi tập trung blockchain lớn nhất thế giới và là Giám đốc điều hành của BitTorrent, công ty phân phối giao thức P2P lớn nhất thế giới. Ông đã trở thành người chiến thắng trong Cuộc đấu giá từ thiện Bữa trưa của Warren Buffett năm nay và cũng sẽ trở thành nhà lãnh đạo toàn cầu. Doanh nhân đầu tiên sau thập niên 90 dùng bữa trưa với Buffett. Justin Sun đã bán "Buffett Luncheon" 2019 với giá kỷ lục là $ 4,567,888 và tất cả số tiền thu được từ cuộc đấu giá đã được quyên góp cho tổ chức từ thiện Glide Foundation có trụ sở tại San Francisco. Warren Buffett, tỷ phú huyền thoại kiêm Giám đốc điều hành của Berkshire Hathaway, đã ủng hộ Quỹ GLIDE trong 20 năm qua dưới hình thức đấu giá bữa trưa để giúp đỡ những người vô gia cư và người nghèo trong quận vùng Vịnh.',
