        FAQtitle1: 'Q1: Băm khối là gì?',
        FAQcontent1:
          'Băm khối là DNA của một phần dữ liệu và mỗi hàm băm khối là duy nhất, ngẫu nhiên và không thể phá vỡ.',
        FAQtitle2: 'Câu hỏi 2: Blockchain là gì?',
        FAQcontent2:
          'Blockchain về bản chất là một cơ sở dữ liệu được chia sẻ trong đó dữ liệu hoặc thông tin được lưu trữ. Nó có các đặc điểm không giả mạo, đầy đủ dấu vết, truy xuất nguồn gốc, tính công khai và minh bạch, và duy trì tập thể.',
        FAQtitle3:
          'Q3: Ví tập trung? Ví phi tập trung? Tại sao ví tập trung không thể truy vấn chuyển tiền?',
        FAQcontent3:
          'Ví dụ: địa chỉ ví của bạn là A, bạn chuyển 10 USDT đến địa chỉ E, nhưng bạn sử dụng giá trị băm của giao dịch để truy vấn, bạn chỉ có thể truy vấn địa chỉ sổ tài khoản ngẫu nhiên B (hoặc C hoặc D, v.v.) của dịch vụ nhà cung cấp vv) chuyển khoản với E. Theo cách tương tự, E không thể biết 10 USDT đã được bạn chuyển hay chưa, vì E chỉ có thể thấy rằng địa chỉ sổ tài khoản B đã chuyển 10 USDT cho anh ta. Đây là lý do tại sao ví tập trung không thể truy vấn thông tin chuyển khoản thực trên blockchain.',
        FAQtitle4: 'Q4: Tại sao tôi liên tục thắng hoặc không thắng?',
        FAQcontent4:
          'Trước hết, đó là một sự kiện xác suất nhỏ (định nghĩa của một sự kiện xác suất nhỏ) không trúng số nhiều lần liên tiếp. Thứ hai, việc trúng và không trúng xổ số là một sự kiện ngẫu nhiên, và tần suất của các sự kiện ngẫu nhiên sẽ có xu hướng ổn định. Trong trường hợp không lặp lại, xác suất xuất hiện của mọi thứ là ngang nhau, trong trường hợp này, mọi người đều công bằng. Đồng thời, các sự kiện ngẫu nhiên sẽ tuân theo quy luật số lớn (trong điều kiện thí nghiệm không thay đổi, lặp lại thí nghiệm nhiều lần, tần suất của các sự kiện ngẫu nhiên tương tự như định nghĩa xác suất của quy luật số lớn), và Trong trường hợp tần suất chuyển tiền ngày càng tăng, việc trúng hay không trúng xổ số sẽ có xu hướng ổn định. Vì vậy bạn hãy tiếp tục chuyển tiền nhé. Khi tần suất chuyển tiền tăng lên, tổng xác suất trúng số sẽ tăng lên.',
