          'Giới thiệu hiệu suất đại lý\n\nVí dụ 1:\n\nCấp siêu giám đốc (Y) đã phát triển được 5 đại lý với tổng lượng giao dịch là 10 triệu, trong đó đại lý A 6 triệu + đại lý B 2 triệu + đại lý C 1 triệu + đại lý D 700.000 + E đại lý 300.000, tính hoa hồng như sau:\n\nTổng hoa hồng = 10 triệu *{0} (tỷ lệ chiết khấu) ={1}\nA = 6 triệu *{2} (tỷ lệ chiết khấu) ={3}\nB = 2 triệu *{4} (tỷ lệ chiết khấu) ={5}\nC = 1 triệu *{6} (tỷ lệ chiết khấu) ={7}\nD = 700.000 *{8} (tỷ lệ chiết khấu) ={9}\nE = 300.000 *{10} (tỷ lệ chiết khấu) ={11}\n\nVí dụ 1 phân rã lược đồ:\n\nThu nhập hàng tuần của cấp giám đốc (Y) ={12}\n\nNgoài ra, đại lý A đã phát triển được 10 cấp dưới với tổng doanh số giao dịch là 6 triệu, mỗi cấp dưới có doanh số giao dịch là 600.000, hoa hồng của mỗi cấp dưới là 600.000 *{13} ={14} thì tính hoa hồng của đại lý A là:\n\nThu nhập hàng tuần của Đại lý A ={15}\n\n\nVí dụ 2:\n\nY đã phát triển được 21 đại lý (A-U) với tổng lượng giao dịch là 20 triệu, đại lý A với lượng giao dịch là 10 triệu và 20 đại lý khác (B-U), mỗi đại lý có số lượng giao dịch là 500.000 và hoa hồng được tính như sau :\n\nTổng hoa hồng = 20 triệu *{16} (tỷ lệ chiết khấu) ={17}\nA = 10 triệu *{18} (tỷ lệ chiết khấu) ={19}\nTổng B-U = 500.000 *{20} (tỷ lệ chiết khấu) * 20 ={21}\n\nVí dụ 2 phân rã lược đồ:\n\nThu nhập hàng tuần của cấp giám đốc (Y) ={22}\n\nĐặc vụ A cũng là một siêu giám đốc, và công thức tính toán cũng giống như của Y, v.v.\n\nMỗi đại lý tham gia băm 58 đều là đại lý cấp 1, đó là: chế độ đại lý siêu không giới hạn;\n\nLưu ý: Tất cả khối lượng giao dịch đại lý là một chu kỳ hàng tuần và nó được tính toán lại vào 24:00 ngày Chủ nhật;\n\nTrọn bộ mô hình kiếm tiền đại lý không cần đầu tư một xu, chỉ cần nhấc điện thoại di động và đăng quảng cáo mỗi ngày, giúp thành viên giải thích trò chơi băm, giới thiệu bạn bè tham gia đại lý, hoa hồng hàng tuần sẽ được tự động chuyển đến cái ví!\n\nBạn tham gia càng sớm, bạn càng kiếm được nhiều tiền và thị trường dành riêng cho những ai chuẩn bị sẵn sàng!\n\nXây dựng một đội bóng như sói, làm giàu không phải là mơ!',
        usdtcreator1:
          'Tether (USDT) là một trong những stablecoin phổ biến nhất. Nó duy trì tỷ lệ giá trị 1-1 so với đô la Mỹ. Tether đang hoạt động trên nhiều blockchain khác nhau. Trong vài năm qua, khối lượng giao dịch của nó liên tục tăng và tính thanh khoản của nó cũng được cải thiện đáng kể. Giống như các stablecoin khác, USDT có lợi cho giao dịch tiền kỹ thuật số, giúp các nhà giao dịch tránh xa sự biến động thị trường của Bitcoin và các tài sản tiền kỹ thuật số khác. Việc sử dụng stablecoin cũng giúp loại bỏ các chi phí bổ sung và sự chậm trễ liên quan đến việc trao đổi tiền tệ kỹ thuật số và tiền pháp định.',
