        Teaminvestmentisrunning3:
          '6月4日午前0時、90年代以降の最初の馬雲湖大学卒業生であり、TRONの創設者でBitTorrentのCEOであるジャスティン・サン氏は、20回目のeBayチャリティーランチの撮影に成功したと発表しました。バフェット チャリティー ランチ」の歴史。 . Justin Sun は、世界最大のブロックチェーン分散型アプリケーション オペレーティング システムである TRON の創設者であり、世界最大の P2P プロトコル配信会社である BitTorrent の CEO です。彼は今年のウォーレン バフェット ランチョン チャリティー オークションの勝者となり、グローバル リーダーにもなるでしょう。バフェットと昼食を共にした最初の90年代以降の起業家。ジャスティン・サンは 2019 年の「バフェット ランチョン」を記録的な価格 4,567,888 ドルで売却し、オークションの収益はすべて、サンフランシスコを拠点とする慈善団体グライド財団に寄付されました。伝説的な億万長者であり、バークシャー ハサウェイの CEO であるウォーレン バフェットは、過去 20 年間、オークション ランチの形でグライド財団を支援し、湾岸地域のホームレスや貧困層を支援してきました。',
