        FAQcontent3:
          '例: あなた自身のウォレット アドレスは A で、10 USDT をアドレス E に転送しますが、トランザクション ハッシュ値を使用してクエリを実行すると、サービスのランダムな口座帳アドレス B (または C または D など) のみをクエリできます。同様に、E は 10 USDT があなたによって送金されたかどうかを知ることができません。なぜなら、E は口座帳アドレス B が 10 USDT を彼に送金したことしか確認できないからです。これが、集中化されたウォレットがブロックチェーン上の実際の転送情報を照会できない理由です。',
