        Teaminvestmentisrunning1:
          'O fundador do TRON (TRX), Justin Sun, formou-se na Lakeside University do presidente executivo do Alibaba, Jack Ma, - o primeiro graduado da geração do milênio do programa. O Sr. Sun foi para Hangzhou, China, para dar palestras e publicar trabalhos de 26 a 28 de março, e completou com sucesso sua carreira acadêmica em três anos de estudo. Na tarde de 26 de março, o Sr. Sun apresentou sua tese de graduação "O Nascimento da Internet Descentralizada", detalhando seus pensamentos sobre o passado, presente e futuro da indústria de blockchain. O Sr. Sun também apresentou sua defesa de dissertação intitulada "Reflexões e Reflexões sobre a Jornada de Quatro Anos de um Empreendedor", onde forneceu uma análise ampla e aprofundada de seus pensamentos e lições aprendidas desde que se tornou um empreendedor em 2014. O Sr. Sun é um dos poucos empreendedores que optam por se envolver na indústria de tecnologia blockchain na Lakeside University. Professores e estudantes universitários, incluindo o reitor acadêmico Zeng Ming, responderam positivamente ao relatório do professor Sun.',
