        Teaminvestmentisrunning3:
          'Às 0:00 do dia 4 de junho, Justin Sun, o primeiro graduado após os anos 90 da Universidade Ma Yunhupan, fundador da TRON e CEO da BitTorrent, anunciou que havia fotografado com sucesso o 20º almoço de caridade do eBay, que se tornou o mais caro " Buffett Charity Lunch" na história. . Justin Sun é o fundador da TRON, o maior sistema operacional de aplicativos descentralizados de blockchain do mundo, e o CEO da BitTorrent, a maior empresa de distribuição de protocolo P2P do mundo. Ele se tornou o vencedor do Warren Buffett Luncheon Charity Auction deste ano e também se tornará um líder global. O primeiro empresário pós-anos 90 a almoçar com Buffett. Justin Sun vendeu o "Buffett Luncheon" de 2019 por um preço recorde de US$ 4.567.888, e todos os lucros do leilão foram doados à instituição de caridade Glide Foundation, com sede em São Francisco. Warren Buffett, o lendário bilionário e CEO da Berkshire Hathaway, apoiou a Fundação GLIDE nos últimos 20 anos na forma de almoços de leilão para ajudar os sem-teto e os pobres do distrito do Golfo.',
