        FAQtitle2: 'Q2: O que é blockchain?',
        FAQcontent2:
          'Blockchain é essencialmente um banco de dados compartilhado no qual dados ou informações são armazenados. Possui as características de não falsificação, rastreamento completo, rastreabilidade, abertura e transparência e manutenção coletiva.',
        FAQtitle3:
          'Q3: Carteira centralizada? Carteira descentralizada? Por que a carteira centralizada não pode consultar a transferência?',
        FAQcontent3:
          'Por exemplo: seu próprio endereço de carteira é A, você transfere 10 USDT para o endereço E, mas você usa o valor de hash da transação para consultar, você só pode consultar um endereço de livro de conta aleatório B (ou C ou D, etc.) do serviço provedor etc) transfere com E. Da mesma forma, E não pode saber se os 10 USDTs foram transferidos por você, porque E só pode ver que o endereço do livro de contas B transferiu 10 USDTs para ele. É por isso que as carteiras centralizadas não podem consultar informações de transferência reais no blockchain.',
        FAQtitle4: 'Q4: Por que continuo ganhando ou não?',
        FAQcontent4:
          'Em primeiro lugar, é um evento de pequena probabilidade (a definição de um evento de pequena probabilidade) que não ganha na loteria muitas vezes seguidas. Em segundo lugar, ganhar e não ganhar na loteria é um evento aleatório, e a frequência de eventos aleatórios tenderá a um valor estável. No caso não iterativo, a probabilidade de as coisas aparecerem é igual a todos, neste caso, todos são justos. Ao mesmo tempo, os eventos aleatórios seguirão a lei dos grandes números (sob a condição de que o experimento não seja alterado, repita o experimento muitas vezes, a frequência dos eventos aleatórios é semelhante à sua definição de probabilidade da lei dos grandes números) e no caso do aumento da frequência de transferências, ganhar ou não ganhar na loteria tenderá a um valor estável. Então, por favor, continue a transferir dinheiro. À medida que a frequência das transferências aumenta, a probabilidade total de ganhar na loteria aumenta.',
