        Teaminvestmentisrunning1:
          'تخرج جاستن صن ، مؤسس شركة TRON (TRX) ، من جامعة جاك ما ليكسايد ، الرئيس التنفيذي لشركة علي بابا ، وهو أول خريج جيل الألفية للبرنامج. ذهب السيد صن إلى مدينة هانغتشو بالصين لإلقاء محاضرات ونشر الأوراق في الفترة من 26 إلى 28 مارس ، وأكمل مسيرته الأكاديمية بنجاح في ثلاث سنوات من الدراسة. بعد ظهر يوم 26 مارس ، قدم السيد صن أطروحة التخرج بعنوان "ولادة الإنترنت اللامركزية" ، والتي توضح بالتفصيل أفكاره حول الماضي والحاضر والمستقبل لصناعة blockchain. كما قدم السيد صن دفاعه عن أطروحته بعنوان "تأملات وتأملات في رحلة مدتها أربع سنوات لرجل أعمال" ، حيث قدم تحليلًا واسعًا ومتعمقًا لأفكاره والدروس المستفادة منذ أن أصبح رائد أعمال في عام 2014. السيد صن هو أحد هؤلاء. من رواد الأعمال القلائل الذين اختاروا المشاركة في صناعة تكنولوجيا blockchain في جامعة ليكسايد. استجاب أساتذة الجامعات والطلاب ، بمن فيهم العميد الأكاديمي زينج مينغ ، بشكل إيجابي لتقرير البروفيسور صن.',
        Teaminvestmentisrunning2:
          'في 17 و 18 يناير ، بالتوقيت المحلي في سان فرانسيسكو ، افتتح مركز يربا بيونا للفنون حدثًا متطورًا باسم blockchain وتقنية العملة الرقمية - نظمته TRON باستضافة من قمة niTROn. 12 خطابًا من المديرين التنفيذيين للشركات ، و 9 منتديات تقنية ، ومحادثة غير مسبوقة بين مؤسس ترون جاستن صن وأسطورة الدوري الاميركي للمحترفين كوبي براينت - الزلزال الخفيف والرياح الجليدية والأمطار في سان فرانسيسكو لا يمكن أن يوقف الأمواج في جميع أنحاء العالم. المكان ، المكان الذي يمكن أن يستوعب آلاف الأشخاص ممتلئ.',
        Teaminvestmentisrunning3:
          'في الساعة 0:00 يوم 4 يونيو ، أعلن جاستن صن ، وهو أول خريج جامعة ما يونهوبان بعد التسعينيات ، ومؤسس TRON ، والرئيس التنفيذي لشركة BitTorrent ، أنه نجح في تصوير حفل الغداء الخيري العشرين على موقع eBay ، والذي أصبح الأعلى سعراً " غداء بافيت الخيري "في التاريخ. . جاستن صن هو مؤسس TRON ، أكبر نظام تشغيل للتطبيقات اللامركزية blockchain في العالم ، والرئيس التنفيذي لشركة BitTorrent ، أكبر شركة توزيع بروتوكول P2P في العالم. لقد أصبح الفائز في مزاد وارن بافيت الخيري لهذا العام وسيصبح أيضًا رائدًا عالميًا. أول رائد أعمال بعد التسعينيات يتناول الغداء مع بافيت. باع جاستن صن فيلم "Buffett Luncheon" لعام 2019 بسعر قياسي بلغ 4،567،888 دولارًا أمريكيًا ، وتم التبرع بجميع عائدات المزاد لمؤسسة Glide Foundation الخيرية ومقرها سان فرانسيسكو. دعم وارن بافيت ، الملياردير الأسطوري والرئيس التنفيذي لشركة Berkshire Hathaway ، مؤسسة GLIDE على مدار العشرين عامًا الماضية في شكل غداء مزاد لمساعدة المشردين والفقراء في المنطقة في الخليج.',
