        FAQtitle2: 'س 2: ما هو blockchain؟',
        FAQcontent2:
          'Blockchain هي أساسًا قاعدة بيانات مشتركة يتم فيها تخزين البيانات أو المعلومات. وتتميز بخصائص عدم التزوير ، والآثار الكاملة ، والتتبع ، والانفتاح والشفافية ، والصيانة الجماعية.',
        FAQtitle3:
          'Q3: المحفظة المركزية؟ المحفظة اللامركزية؟ لماذا لا تستطيع المحفظة المركزية الاستعلام عن التحويل؟',
        FAQcontent3:
          'على سبيل المثال: عنوان محفظتك الخاصة هو A ، تقوم بتحويل 10 USDT إلى العنوان E ، لكنك تستخدم قيمة تجزئة المعاملة للاستعلام ، يمكنك فقط الاستعلام عن عنوان دفتر حساب عشوائي B (أو C أو D ، إلخ) للخدمة مزود الخ) التحويلات مع E. بالطريقة نفسها ، لا يمكن لـ E معرفة ما إذا تم تحويل 10 USDT بواسطتك ، لأن E يمكنه فقط رؤية أن عنوان دفتر الحساب B قام بتحويل 10 USDTs إليه. هذا هو السبب في أن المحافظ المركزية لا يمكنها الاستعلام عن معلومات التحويل الحقيقية على blockchain.',
        FAQtitle4: 'س 4: لماذا أستمر في الفوز أو لا أفوز؟',
        FAQcontent4:
          'بادئ ذي بدء ، هو حدث احتمالي صغير (تعريف حدث احتمالي صغير) لا يفوز باليانصيب عدة مرات متتالية. ثانيًا ، يعتبر الفوز باليانصيب وعدم الفوز به حدثًا عشوائيًا ، ويميل تكرار الأحداث العشوائية إلى قيمة ثابتة. في الحالة غير التكرارية ، يكون احتمال ظهور الأشياء مساويًا للجميع ، وفي هذه الحالة يكون الجميع عادلين. في الوقت نفسه ، ستتبع الأحداث العشوائية قانون الأعداد الكبيرة (بشرط عدم تغيير التجربة ، كرر التجربة عدة مرات ، وتكرار الأحداث العشوائية مشابه لتعريفها الاحتمالي لقانون الأعداد الكبيرة) ، و في حالة التكرار المتزايد لعمليات النقل ، فإن الفوز باليانصيب أو عدم الفوز به سيميل إلى استقرار القيمة. لذا يرجى الاستمرار في تحويل الأموال. مع زيادة تواتر عمليات النقل ، سيزداد الاحتمال الإجمالي للفوز باليانصيب.',
