        FAQtitle2: 'P2: ¿Qué es la cadena de bloques?',
        FAQcontent2:
          'Blockchain es esencialmente una base de datos compartida en la que se almacenan datos o información. Tiene las características de no falsificación, trazas completas, trazabilidad, apertura y transparencia, y mantenimiento colectivo.',
        FAQtitle3:
          'P3: ¿Monedero centralizado? ¿Monedero descentralizado? ¿Por qué la billetera centralizada no puede consultar la transferencia?',
        FAQcontent3:
          'Por ejemplo: su propia dirección de billetera es A, transfiere 10 USDT a la dirección E, pero usa el valor hash de la transacción para consultar, solo puede consultar una dirección de libro de cuenta aleatoria B (o C o D, etc.) del servicio proveedor, etc.) transferencias con E. De la misma manera, E no puede saber si usted transfirió los 10 USDT, porque E solo puede ver que la dirección del libro de cuentas B le transfirió 10 USDT. Esta es la razón por la cual las billeteras centralizadas no pueden consultar información de transferencia real en la cadena de bloques.',
        FAQtitle4: 'P4: ¿Por qué sigo ganando o sin ganar?',
        FAQcontent4:
          'En primer lugar, es un evento de pequeña probabilidad (la definición de un evento de pequeña probabilidad) que no gana la lotería muchas veces seguidas. En segundo lugar, ganar y no ganar la lotería es un evento aleatorio y la frecuencia de los eventos aleatorios tenderá a un valor estable. En el caso no iterativo, la probabilidad de que aparezcan las cosas es igual para todos, en este caso, todos son justos. Al mismo tiempo, los eventos aleatorios seguirán la ley de los grandes números (bajo la condición de que el experimento no cambie, repita el experimento muchas veces, la frecuencia de los eventos aleatorios es similar a su definición de probabilidad de la ley de los grandes números), y en el caso de la creciente frecuencia de transferencias, ganar o no ganar la lotería tenderá a un valor estable. Por lo tanto, continúe transfiriendo dinero. A medida que aumenta la frecuencia de las transferencias, aumentará la probabilidad total de ganar la lotería.',
