        Teaminvestmentisrunning1:
          "Der Gründer von TRON (TRX), Justin Sun, schloss sein Studium an der Lakeside University des Alibaba Executive Chairman Jack Ma ab – der erste tausendjährige Absolvent des Programms. Herr Sun ging vom 26. bis 28. März nach Hangzhou, China, um Vorträge zu halten und Artikel zu veröffentlichen, und schloss seine akademische Laufbahn in drei Studienjahren erfolgreich ab. Am Nachmittag des 26. März reichte Herr Sun seine Abschlussarbeit „The Birth of the Decentralized Internet“ ein, in der er seine Gedanken zur Vergangenheit, Gegenwart und Zukunft der Blockchain-Industrie detailliert darlegte. Herr Sun reichte auch seine Dissertationsverteidigung mit dem Titel „Reflections and Reflections on an Entrepreneur's Four-Year Journey“ ein, in der er eine breite und gründliche Analyse seiner Gedanken und Lehren lieferte, die er gelernt hatte, seit er 2014 Unternehmer wurde. Herr Sun ist einer einer der wenigen Unternehmer, die sich dafür entscheiden, sich an der Lakeside University in der Blockchain-Technologieindustrie zu engagieren. Universitätsprofessoren und Studenten, einschließlich des Akademischen Dekans Zeng Ming, reagierten positiv auf den Bericht von Professor Sun.",
