        FAQtitle1: 'F1: Was ist ein Block-Hash?',
        FAQcontent1:
          'Ein Block-Hash ist die DNA eines Datenstücks, und jeder Block-Hash ist einzigartig, zufällig und unzerbrechlich.',
        FAQtitle2: 'F2: Was ist Blockchain?',
        FAQcontent2:
          'Blockchain ist im Wesentlichen eine gemeinsam genutzte Datenbank, in der Daten oder Informationen gespeichert werden. Es hat die Eigenschaften Fälschungsfreiheit, vollständige Spuren, Rückverfolgbarkeit, Offenheit und Transparenz sowie kollektive Wartung.',
        FAQtitle3:
          'Q3: Zentralisierte Geldbörse? Dezentrale Geldbörse? Warum kann das zentrale Wallet die Überweisung nicht abfragen?',
        FAQcontent3:
          'Zum Beispiel: Ihre eigene Wallet-Adresse ist A, Sie überweisen 10 USDT an Adresse E, aber Sie verwenden den Transaktionshashwert zur Abfrage, Sie können nur eine zufällige Kontobuchadresse B (oder C oder D usw.) des Dienstes abfragen Anbieter usw.) mit E überweist. Ebenso kann E nicht wissen, ob die 10 USDT von Ihnen überwiesen wurden, da E nur sehen kann, dass die Kontobuchadresse B 10 USDT an ihn überwiesen hat. Aus diesem Grund können zentralisierte Wallets keine echten Überweisungsinformationen auf der Blockchain abfragen.',
        FAQtitle4: 'F4: Warum gewinne ich weiter oder gewinne ich nicht?',
        FAQcontent4:
          'Zunächst einmal ist es ein kleines Wahrscheinlichkeitsereignis (die Definition eines kleinen Wahrscheinlichkeitsereignisses), das nicht viele Male hintereinander im Lotto gewinnt. Zweitens ist das Gewinnen und Nichtgewinnen im Lotto ein zufälliges Ereignis, und die Häufigkeit zufälliger Ereignisse tendiert zu einem stabilen Wert. Im nicht iterativen Fall ist die Wahrscheinlichkeit des Auftretens für alle gleich, in diesem Fall sind alle fair. Gleichzeitig folgen zufällige Ereignisse dem Gesetz der großen Zahlen (unter der Bedingung, dass das Experiment unverändert ist, wiederholen Sie das Experiment viele Male, die Häufigkeit zufälliger Ereignisse ähnelt seiner Wahrscheinlichkeitsdefinition des Gesetzes der großen Zahlen) und bei steigender überweisungshäufigkeit wird der lottogewinn oder nichtgewinn zu einem stabilen wert tendieren. Also bitte weiter Geld überweisen. Wenn die Häufigkeit der Überweisungen zunimmt, steigt die Gesamtwahrscheinlichkeit, im Lotto zu gewinnen.',
