        FAQtitle2: "Q2 : Qu'est-ce que la blockchain ?",
        FAQcontent2:
          "La blockchain est essentiellement une base de données partagée dans laquelle des données ou des informations sont stockées. Il présente les caractéristiques de non-falsification, de traces complètes, de traçabilité, d'ouverture et de transparence, et de maintenance collective.",
        FAQtitle3:
          'Q3 : Portefeuille centralisé ? Portefeuille décentralisé ? Pourquoi le portefeuille centralisé ne peut-il pas interroger le transfert ?',
        FAQcontent3:
          "Par exemple : votre propre adresse de portefeuille est A, vous transférez 10 USDT à l'adresse E, mais vous utilisez la valeur de hachage de la transaction pour interroger, vous ne pouvez interroger qu'une adresse de livre de comptes aléatoire B (ou C ou D, etc.) du service fournisseur etc) transfère avec E. De la même manière, E ne peut pas savoir si les 10 USDT ont été transférés par vous, car E peut seulement voir que l'adresse du carnet de comptes B lui a transféré 10 USDT. C'est pourquoi les portefeuilles centralisés ne peuvent pas interroger les informations de transfert réelles sur la blockchain.",
        FAQtitle4:
          'Q4 : Pourquoi est-ce que je continue à gagner ou à ne pas gagner ?',
        FAQcontent4:
          "Tout d'abord, c'est un petit événement de probabilité (la définition d'un petit événement de probabilité) qui ne gagne pas la loterie plusieurs fois de suite. Deuxièmement, gagner et ne pas gagner à la loterie est un événement aléatoire, et la fréquence des événements aléatoires tendra vers une valeur stable. Dans le cas non itératif, la probabilité que les choses apparaissent est égale à tout le monde, dans ce cas, tout le monde est juste. Dans le même temps, les événements aléatoires suivront la loi des grands nombres (à condition que l'expérience soit inchangée, répétez l'expérience plusieurs fois, la fréquence des événements aléatoires est similaire à sa définition de probabilité de la loi des grands nombres), et dans le cas de la fréquence croissante des transferts, gagner ou ne pas gagner à la loterie tendra vers une valeur stable. Veuillez donc continuer à transférer de l'argent. À mesure que la fréquence des transferts augmente, la probabilité totale de gagner à la loterie augmentera.",
