          'Il fondatore di TRON (TRX), Justin Sun, si è laureato presso la Lakeside University, presidente esecutivo di Alibaba, Jack Ma, il primo laureato millennial del programma. Il signor Sun è andato a Hangzhou, in Cina, per tenere conferenze e pubblicare articoli dal 26 al 28 marzo, e ha completato con successo la sua carriera accademica in tre anni di studio. Nel pomeriggio del 26 marzo, il signor Sun ha presentato la sua tesi di laurea "The Birth of the Decentralized Internet", descrivendo in dettaglio i suoi pensieri sul passato, presente e futuro dell\'industria blockchain. Il signor Sun ha anche presentato la sua difesa della tesi intitolata "Riflessioni e riflessioni sul viaggio quadriennale di un imprenditore", dove ha fornito un\'analisi ampia e approfondita dei suoi pensieri e delle lezioni apprese da quando è diventato un imprenditore nel 2014. Il signor Sun è uno dei pochi imprenditori che scelgono di essere coinvolti nel settore della tecnologia blockchain presso la Lakeside University. Professori e studenti universitari, tra cui il preside accademico Zeng Ming, hanno risposto positivamente al rapporto del professor Sun.',
