        FAQtitle3:
          'Q3: portafoglio centralizzato? Portafoglio decentralizzato? Perché il portafoglio centralizzato non può interrogare il trasferimento?',
        FAQcontent3:
          "Ad esempio: il tuo indirizzo di portafoglio è A, trasferisci 10 USDT all'indirizzo E, ma usi il valore hash della transazione per interrogare, puoi solo interrogare un indirizzo di libro contabile casuale B (o C o D, ecc.) del servizio provider ecc.) trasferisce con E. Allo stesso modo, E non può sapere se i 10 USDT sono stati trasferiti da te, perché E può vedere solo che l'indirizzo della rubrica B gli ha trasferito 10 USDT. Questo è il motivo per cui i portafogli centralizzati non possono richiedere informazioni di trasferimento reali sulla blockchain.",
        FAQtitle4: 'Q4: Perché continuo a vincere o non vincere?',
        FAQcontent4:
          "Innanzitutto, è un piccolo evento di probabilità (la definizione di piccolo evento di probabilità) che non vince alla lotteria molte volte di seguito. In secondo luogo, vincere e non vincere alla lotteria è un evento casuale e la frequenza degli eventi casuali tenderà a un valore stabile. Nel caso non iterativo la probabilità che le cose appaiano è uguale a tutti, in questo caso tutti sono equi. Allo stesso tempo, gli eventi casuali seguiranno la legge dei grandi numeri (a condizione che l'esperimento sia invariato, ripetere l'esperimento molte volte, la frequenza degli eventi casuali è simile alla sua definizione di probabilità della legge dei grandi numeri) e nel caso della crescente frequenza dei trasferimenti, vincere o non vincere alla lotteria tenderà a un valore stabile. Quindi, per favore, continua a trasferire denaro. All'aumentare della frequenza dei trasferimenti, aumenterà la probabilità totale di vincere alla lotteria.",
