          '대행사 실적 소개\r\n\r\n예 1:\r\n\r\n슈퍼디렉터 레벨(Y)은 총 거래량이 1천만인 5개의 에이전트를 개발했으며 그 중 A 에이전트 600만 + B 에이전트 200만 + C 에이전트 100만 + D 에이전트 700,000 + E 에이전트 300,000, 수수료 계산은 다음과 같습니다. 다음과 같습니다.\r\n\r\n총 수수료 = 1천만 * {0}(리베이트 비율) = {1}\r\nA=6백만*{2}(리베이트 비율)={3}\r\nB=2백만*{4}(리베이트 비율)={5}\r\nC=100만*{6}(리베이트 비율)={7}\r\nD=700,000*{8}(리베이트 비율)={9}\r\nE=300,000*{10}(리베이트 비율)={11}\r\n\r\n예 1 스키마 분해:\r\n\r\n슈퍼 디렉터 레벨(Y) 주간 수입 = {12}\r\n\r\n또한 에이전트 A는 총 거래량이 6백만인 부하 10명을 개발했으며 각 부하의 거래량은 600,000이고 각 부하의 수수료는 600,000*{13}={14}이고 에이전트 A의 수수료 계산은 다음과 같습니다.\r\n\r\n에이전트 A의 주간 수입 = {15}\r\n\r\n\r\n예 2:\r\n\r\nY는 총 거래량이 2000만 건인 21개 에이전트(A-U), 거래량이 1000만 개인 에이전트 A, 기타 20개 에이전트(B-U)를 각각 거래량 500,000개로 개발했으며 수수료는 다음과 같이 계산됩니다. :\r\n\r\n총 수수료 = 2천만 * {16}(리베이트 비율) = {17}\r\nA=1천만*{18}(리베이트 비율)={19}\r\n총 B-U = 500,000*{20}(리베이트 비율)*20={21}\r\n\r\n예 2 스키마 분해:\r\n\r\n슈퍼 디렉터 레벨(Y) 주간 수입 = {22}\r\n\r\nA 요원도 슈퍼 디렉터이고 계산식은 Y와 같은 식이다.\r\n\r\n58 해시에 참여하는 각 에이전트는 1단계 에이전트이며, 이는 다음과 같습니다. 슈퍼 무제한 에이전트 모드;\r\n\r\n참고: 모든 에이전시 거래량은 매주 주기이며 일요일 24:00에 다시 계산됩니다.\r\n\r\n에이전시 머니 모델의 전체 세트는 1페니를 투자할 필요가 없으며, 휴대전화를 들고 매일 광고하고, 회원이 해시 게임을 설명하도록 돕고, 에이전시에 가입하도록 친구를 소개하고, 주간 커미션은 자동으로 이전됩니다. 지갑!\r\n\r\n빨리 가입할수록 더 많은 돈을 벌고 시장은 준비된 사람들을 위해 예약됩니다!\r\n\r\n늑대 같은 팀을 만들고 부자가 되는 것은 꿈이 아닙니다!',
