        FAQtitle3:
          'Q3：中心化錢包？去中心化錢包？為什麼中心化錢包無法查詢轉賬？',
        FAQcontent3:
          '舉一個例子：您自己的錢包地址是A，您給地址E轉入10個USDT，但您用交易哈希值去查詢，只能查詢到服務商隨機某個賬本地址B（或C或D等等）與E的轉賬。同理E也無法得知這10個USDT是否是您轉出的，因為E只能看見是賬本地址B給他轉入10個USDT。這就是為什麼中心化錢包無法在區塊鏈上查詢真實轉賬信息。',
        FAQtitle4: 'Q4：為什麼我會連續中獎或不中獎？',
        FAQcontent4:
          '首先連續多次不中獎的是小概率事件（小概率事件定義），其次中獎與不中獎是隨機事件，隨機事件的發生的頻率會趨於一個穩定值。在非迭代的情況下，事物出現的概率對每個人來講是相等的，這個情況下，每個人都是公平的。同時隨機事件會遵大數定律（在試驗不變的條件下，重複試驗多次，隨機事件的頻率近似於它的概率大數定律定義），在轉賬頻次不斷增加的情況下，中獎與不中獎的概率會趨於一個穩定值。所以請您繼續轉賬，隨著轉賬頻次增加則中獎總概率會提升。',
