        Agencyperformanceintroduction:
          '代理業績介紹\r\n\r\n示例1：\r\n\r\n超級總監級(Y)發展了5個代理總計是1000萬的交易量，其中A代理600萬+B代理200萬+C代理100萬+D代理70萬+E代理30萬，佣金計算如下：\r\n\r\n總佣金=1000萬*{0}(返佣比例)={1}\r\nA=600萬*{2}(返佣比例)={3}\r\nB=200萬*{4}(返佣比例)={5}\r\nC=100萬*{6}(返佣比例)={7}\r\nD=70萬*{8}(返佣比例)={9}\r\nE=30萬*{10}(返佣比例)={11}\r\n\r\n示例1模式分解：\r\n\r\n超級總監級(Y)一周收益={12}\r\n\r\n另外，A代理髮展了10個下級總計是600萬的交易量，每個下級各是60萬交易量，每個下級的佣金為60萬*{13}={14}，則A代理的佣金計算：\r\n\r\nA代理一周收益={15}\r\n\r\n\r\n示例2：\r\n\r\nY發展了21個代理(A-U)總計是2000萬的交易量，代理A交易量為1000萬，其它20個代理(B-U)，每個交易量為50萬，佣金計算如下：\r\n\r\n總佣金=2000萬*{16}(返佣比例)={17}\r\nA=1000萬*{18}(返佣比例)={19}\r\nB-U合計=50萬*{20}(返佣比例)*20={21}\r\n\r\n示例2模式分解：\r\n\r\n超級總監級(Y)一周收益={22}\r\n\r\nA代理也是超級總監級，計算公式與Y相同，以此類推。\r\n\r\n每個加入58哈希的代理都是一級代理，這就是：超級無限代理模式；\r\n\r\n注：所有代理交易量每週為一個週期，星期天24:00重新計算；\r\n\r\n整套代理錢模式不用投資一分錢，只需要每天拿起手機發發廣告，幫自己的會員講解哈希遊戲，介紹朋友加入代理，每週的佣金自動轉入錢包！\r\n\r\n越早加入，賺錢越多，市場是留給有準備的人！\r\n\r\n建立一組狼性的團隊，發家致富不是夢！',
