          '"{0}" öz sermaye yatırım planına katılın ve her gün istikrarlı bir gelir elde edin\r\nÖz sermaye gelir planına yeniden yüklendikten ve başarılı bir şekilde katıldıktan sonra özkaynak dönemi 180 gündür.Kullanıcılar "{1}" tarafından taahhüt edilen değişken geliri her gün geri çekebilir ve tüm yatırım anaparasını geri çekmeyi veya vadesi dolduğunda öz sermayeye yatırım yapmaya devam etmeyi seçebilir. .\r\n1. "{2}" temel akıllı yazılımı, çeşitli tanınmış çevrimiçi kumarhanelerdeki piyango verilerini toplar, akıllıca analiz eder, doğru tahminlerde bulunur ve şirketin ve tüm hissedarların fonlarını günün 24 saati çeşitli oyunlara otomatik olarak bahis yapmak için kullanır. Büyük sermaye avantajları ve temel akıllı teknoloji ile en istikrarlı ve en iyi gelir etkisini elde edebilir. Kazançlar gün boyunca gerçek zamanlı olarak güncellenir ve dalgalanacaktır.Kazançlar her gün tutarsızdır, ancak vaat edilen kazanç değerine ulaşabilir.\r\n2. "{3}", finansal destek sağlamak için bir dizi çevrimiçi finans kurumuyla işbirliği yapar. Kooperatif finans kuruluşlarının online kredi işi ve kod yıkama işi sayesinde daha istikrarlı kar geliri elde edilebilir.\r\nHissedarlar, yatırım tutarına ve hisse senedi derecesine göre ilgili geliri alacaklar ve gelir, İngiltere saat diliminde ertesi gün saat 01:00\'de güncellemeden sonra alınacaktır.\r\nÜyeler, arkadaşlarını katılmaya davet ederek ek komisyon geliri elde edebilirler. Ayrıntılar için lütfen görüntülemek için paylaşım sayfasına tıklayın.\r\n(Özkaynak gelir planına katılmak için lütfen özkaynak sayfasını tıklayın)',
