          'Her şeyden önce, piyangoyu arka arkaya birçok kez kazanmayan küçük bir olasılık olayıdır (küçük bir olasılık olayının tanımı). İkincisi, piyangoyu kazanmak ve kazanmamak rastgele bir olaydır ve rastgele olayların sıklığı sabit bir değere eğilim gösterecektir. Yinelemeli olmayan durumda, şeylerin ortaya çıkma olasılığı herkese eşittir, bu durumda herkes adildir. Aynı zamanda, rastgele olaylar büyük sayılar yasasını izleyecektir (deneyin değişmemesi koşuluyla, deneyi birçok kez tekrarlayın, rastgele olayların sıklığı, büyük sayılar yasasının olasılık tanımına benzer) ve artan transfer sıklığı durumunda, piyangoyu kazanmak veya kazanmamak sabit bir değere yönelecektir. Bu yüzden lütfen para transferine devam edin. Transferlerin sıklığı arttıkça, piyangoyu kazanma olasılığı da artacaktır.',
